import React from 'react';
import Flip from './flip';
const texts = [
  {
    id: 1,
    title: 'Tráfego Pago',
    descriptionFront: 'Aumente a visibilidade do seu negócio através de anúncios segmentados nas principais redes sociais e mecanismos de busca.',
    descriptionBack: 'Com o tráfego pago, é possível gerar resultados mais rapidamente e alcançar um público maior e mais qualificado para o seu negócio.',
    imageSrc: 'https://images.unsplash.com/photo-1556740774-8c7f7176a518?ixlib=rb-1.2.1&auto=format&fit=crop&w=634&q=80'
  },
  {
    id: 2,
    title: 'Marketing Digital',
    descriptionFront: 'Desenvolva estratégias de marketing digital para o seu negócio e alcance mais clientes por meio das redes sociais, e-mail marketing, SEO, entre outros.',
    descriptionBack: 'O marketing digital é essencial para aumentar a visibilidade do seu negócio na internet e atrair clientes em potencial. Conte com nossos especialistas para desenvolver uma estratégia completa.',
    imageSrc: 'https://images.unsplash.com/photo-1521737711867-5a810fda9663?ixlib=rb-1.2.1&auto=format&fit=crop&w=634&q=80'
  }
];
const FlipContainer = () => {
  return (
    <section className=" flex h-[300px]  w-[100%] flex-col md:flex-row md:flex-wrap justify-center items-center max-w-6xl mx-auto py-8 ">
      {texts.map((item) => (
        <Flip

          key={item.id}
          title={item.title}
          descriptionFront={item.descriptionFront}
          descriptionBack={item.descriptionBack}
          imageSrc={item.imageSrc}
        />
      ))}
    </section>
  );
};

export default FlipContainer ;
